import React, { useState } from 'react';
import styles from '../Main/Main.module.css';
import Vacancy from '../routes/vacancy/Vacancy';
import JobsList from '../routes/list/JobsList';
import { PageHeader } from 'antd';
import AppContext from '../helpers/AppContext';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

const App = () => {
  const [dataList, setDataList] = useState([]);

  const dataSettings = {
    dataList,
    setDataList,
  };

  return (
    <AppContext.Provider value={dataSettings}>
      <div>
        <header className="App-header">
          <PageHeader backIcon={false} title="Vacancy Finding App" />
        </header>
        <main>
          <BrowserRouter>
            <Routes>
              <Route exact path="/" element={<JobsList />} />
              <Route exact path="/vacancy/:slug" element={<Vacancy />} />
              <Route
                path="*"
                element={
                  <main>
                    <p>There's nothing here!</p>
                  </main>
                }
              />
            </Routes>
          </BrowserRouter>
        </main>
      </div>
    </AppContext.Provider>
  );
};

function Main() {
  return (
    <div>
      <div className={styles.header}>
        <img width={100} height={100} src="./img/logo.png" alt="" />
        <a className={styles.login} href="">
          login
        </a>
      </div>
      <div className={styles.fblock}>
        <img width={850} height={516} src="./img/left.png" alt="" />
        <img width={820} height={516} src="./img/right.png" alt="" />
        <p className={styles.find}>find your job here</p>
        <p className={styles.findt}>find employees here</p>
      </div>
      <div className={styles.midle}>midle</div>
      <div className={styles.midle}>second midle</div>
      <footer></footer>
    </div>
  );
}

export default Main;
